import { Routes, Route, Link} from 'react-router-dom';
import { Search } from './pages/Search';
import { Media } from './pages/Media';
import { Favourite } from './pages/Favourite';
import { Playlist_constructor } from './pages/PlaylistConstructor';

function App() {
  return (  
    <div className="App">
      <nav>
        <ul>
          <li><Link to="/">Главная</Link></li>
          <li><Link to="/search">Поиск</Link></li>
          <li><Link to="/media">Медиатека</Link></li>
          <li><Link to="/playlist-constructor">Создать плейлист</Link></li>
          <li><Link to="/favourite">Любимые треки</Link></li>
        </ul>
      </nav>
      <Routes>
        <Route path='/search' element={<Search></Search>}></Route>
        <Route path='/media' element={<Media></Media>}></Route>
        <Route path='/playlist-constructor' element={<Playlist_constructor></Playlist_constructor>}></Route>
        <Route path='/favourite' element={<Favourite></Favourite>}></Route>
      </Routes>
    </div>
  );
}

export default App;
